import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'
import { handleSuccess } from '../utils'
import './Home.css'

const Home = () => {
  const [loggedInUser, setLoggedInUser] = useState('')
  const navigate = useNavigate()

  // Booking form state
  const [formData, setFormData] = useState({
    professor: '',
    department: '',
    school: '',
    date: '',
    timeSlot: ''
  })
  

  const [bookings, setBookings] = useState([])

  useEffect(() => {
    setLoggedInUser(localStorage.getItem('handleLogout'))
  }, [])

  const handleLogout = () => {
    localStorage.removeItem('token')
    localStorage.removeItem('handleLogout')
    handleSuccess('User Logged Out')
    setTimeout(() => {
      navigate('/login')
    }, 1000)
  }

  // Handle input change
  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    })
  }

  // Submit booking
  const handleSubmit = (e) => {
    e.preventDefault()

    if (
      !formData.professor ||
      !formData.department ||
      !formData.school ||
      !formData.date ||
      !formData.timeSlot
    ) {
      alert('Please fill all fields')
      return
    }

    setBookings([...bookings, formData])

    // Reset form
    setFormData({
      professor: '',
      department: '',
      school: '',
      date: '',
      timeSlot: ''
    })
  }

  return (
    <>
      {/* Navigation Bar */}
      <div className="navbar">
        <span className="nav-user">Welcome {loggedInUser}</span>
        <button className="logout-btn" onClick={handleLogout}>
          Logout
        </button>
      </div>

      {/* Page Content */}
      <div className="home-content">

        <h2>Conference Room Booking</h2>

        {/* Booking Form */}
        <form className="booking-form" onSubmit={handleSubmit}>
          <input
            type="text"
            name="professor"
            placeholder="Professor Name"
            value={formData.professor}
            onChange={handleChange}
          />

          <input
            type="text"
            name="department"
            placeholder="Department"
            value={formData.department}
            onChange={handleChange}
          />

          <input
            type="text"
            name="school"
            placeholder="School"
            value={formData.school}
            onChange={handleChange}
          />

          <input
            type="date"
            name="date"
            value={formData.date}
            onChange={handleChange}
          />

          <select
            name="timeSlot"
            value={formData.timeSlot}
            onChange={handleChange}
          >
            <option value="">Select Time Slot</option>
            <option>09:00 - 10:00</option>
            <option>10:00 - 11:00</option>
            <option>11:00 - 12:00</option>
            <option>02:00 - 03:00</option>
            <option>03:00 - 04:00</option>
          </select>

          <button type="submit">Book Room</button>
        </form>

        {/* Booking List */}
        <h3>Booked Slots</h3>

        {bookings.length === 0 ? (
          <p>No bookings yet</p>
        ) : (
          <table className="booking-table">
            <thead>
              <tr>
                <th>Professor</th>
                <th>Department</th>
                <th>School</th>
                <th>Date</th>
                <th>Time Slot</th>
              </tr>
            </thead>
            <tbody>
              {bookings.map((b, index) => (
                <tr key={index}>
                  <td>{b.professor}</td>
                  <td>{b.department}</td>
                  <td>{b.school}</td>
                  <td>{b.date}</td>
                  <td>{b.timeSlot}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}

      </div>
    </>
  )
}

export default Home
